def average(list):
    sums = 0
    count = 0
    for i in list:
        sums += list[count]
        count += 1
    avg = sums / count
    return avg

def realGrid(departure, hour, date):
    grid = hubway.initializeGrid(hubway.STATIONS)
    for stime, sstation, etime, estation in hubway.trips():
        if departure:
            time = stime
        else:
            time = etime
        if time.date() == date and time.timetuple().tm_hour == hour:
            grid[sstation][estation] += 1
        if time.date() > date:
            break
    return grid


